import { Route, Routes } from 'react-router-dom';
import './App.css';
import { Header } from './components/Header/Header';
import { Login } from './components/Login/Login';

function App() {

    return (

        <div className="App">
            <Routes>
                <Route path='/login' element={< Login />} />
            </Routes>
          <Header/>  
        </div>
    );
}

export default App;
